import shutil
import sys
BASE_PATH = "/home/macalester/PycharmProjects/tf_floortype_classifier/"

CARPET_LABEL = 0
TILE_LABEL = 1

TRAIN_DIR_PATH = os.path.join(
    BASE_PATH,
    "markedFrames/floorframes/")

CARPET_DIR_PATH = os.path.join(
    BASE_PATH,
    "markedFrames/carpet/")
TILE_DIR_PATH = os.path.join(
    BASE_PATH,
    "markedFrames/tile/")

TEST_DIR_PATH = os.path.join(
    BASE_PATH,
    "markedFrames/testframes/"
)

CLASS_DICT = {
    "tile": TILE_LABEL,
    "carpet": CARPET_LABEL
}

CLASSIFIED_DIR_PATH = os.path.join(
    BASE_PATH,
    "markedFrames/allfloorframes/"
)
#TODO: Incorporate startfileame to be more user friendly
def build_database(datapath, class_dict, outputpath):
    tile_filenames = set()
    carpet_filenames = set()
    unclassified_filenames = set()  # in between carpet and tile
    datalist = os.listdir(datapath)
    for framename in datalist:
        if (framename.endswith("jpg")):
            framepath = os.path.join(
                datapath,
                framename
            )
            image = cv2.imread(framepath)
            cv2.imshow("Image", image)
            x = cv2.waitKey(0)
            ch = chr(x & 0xFF)

            if (not os.path.exists(CLASSIFIED_DIR_PATH)):
                os.mkdir(path=CLASSIFIED_DIR_PATH)


            if ch == "q":
                break
            elif ch == "t":
                tile_filenames.add(framepath)
                newname = framename.rstrip(".jpg") + "_tile.jpg"
                shutil.copy2(
                    src=framepath,
                    dst=CLASSIFIED_DIR_PATH
                )
                os.rename(
                    src=os.path.join(CLASSIFIED_DIR_PATH, framename),
                    dst=os.path.join(CLASSIFIED_DIR_PATH, newname)
                )
            elif ch == "c":
                carpet_filenames.add(framepath)
                newname = framename.rstrip(".jpg") + "_carpet.jpg"
                shutil.copy2(
                    src=framepath,
                    dst=CLASSIFIED_DIR_PATH
                )
                os.rename(
                    src=os.path.join(CLASSIFIED_DIR_PATH, framename),
                    dst=os.path.join(CLASSIFIED_DIR_PATH, newname)
                )
            else:
                unclassified_filenames.add(framepath)

    print("tile_filenames", tile_filenames)
    print("carpet_filenames", carpet_filenames)
    print("unclassified_filenames", unclassified_filenames)

def main():
    build_database(
        datapath="/Users/jlim2/Desktop/allFrames/",
        class_dict=CLASS_DICT,
        outputpath=""
    )
